import { useState } from "react";
import "../styles/navbar.css";
import { Auth0_TEXT, Cypress_TEXT, GraphQl_Text, Jest_Text } from "../Text";

export const ImagesAnimation5 = () => {
  const [clickedImage, setClickedImage] = useState("Cypress");

  const handleClick = (imageName: string) => {
    setClickedImage(imageName);
  };

  const renderText = () => {
    switch (clickedImage) {
      case "Cypress":
        return <Cypress_TEXT />;
        break;
      case "JEST":
        return <Jest_Text />;
        break;
      case "GraphQl":
        return <GraphQl_Text />;
        break;
      case "Auth0":
        return <Auth0_TEXT />;
        break;
    }
  };
  return (
    <div className="flex flex-row w-[900px] justify-between">
      <ul className="w-[500px] p-0 h-fit text-white">
        <li>{clickedImage}</li>
        <div>{clickedImage ? <li>{renderText()}</li> : ""}</div>
      </ul>

      <div className="w-[5px] bg-[#FFF] h-[300px] rounded-xl z-10"></div>

      <div className="gallery ">
        <img
          onClick={() => handleClick("Cypress")}
          style={{
            width: "300px",
            height: "300px",
            objectFit: "contain",
            background: "black",
          }}
          src="data:image/jpeg;base64,"
          alt="Cypress"
        />
        <img
          onClick={() => handleClick("JEST")}
          style={{
            width: "300px",
            height: "300px",
            objectFit: "contain",
            background: "black",
          }}
          src="data:image/png;base64,"
          alt="JEST"
        />
        <img
          onClick={() => handleClick("GraphQl")}
          style={{
            width: "300px",
            height: "300px",
            objectFit: "contain",
            background: "black",
          }}
          src="data:image/png;base64,"
          alt="GraphQl"
        />
        <img
          onClick={() => handleClick("Auth0")}
          style={{
            width: "300px",
            height: "300px",
            objectFit: "cover",
            background: "black",
          }}
          src="data:image/png;base64,"
          alt="Auth0"
        />
      </div>
    </div>
  );
};
